// Fungsi untuk mendekripsi dan menampilkan hasil de-obfuscation
function deobfuscate(input) {
    // Array untuk menggantikan pola obfuscation dengan hasil yang lebih mudah dibaca
    const obfuscated = {
        '!![]': 'true',  // !![] mengubah menjadi 'true'
        '!![]+[]': 'true', // !![]+[] mengubah menjadi 'true'
        '+[]': '0',  // +[] menjadi angka 0
        '[]': '',  // [] menjadi string kosong
        '(![]+[])': 'false',  // ![]+[] mengubah menjadi 'false'
        // Tambahkan lebih banyak penggantian sesuai pola yang dikenali
    };

    // Mengganti pola obfuscation dengan nilai yang lebih mudah dibaca
    for (const pattern in obfuscated) {
        input = input.replace(new RegExp(pattern, 'g'), obfuscated[pattern]);
    }

    return input;
}

